    itineraire:
      "<p>S’élever au-dessus de la mairie pour passer devant le cimetière et rejoindre le hameau de la Jars, principalement par la route. Poursuivre en direction du lieu-dit « les Touches » et monter par une piste règlementée et récemment goudronnée pour gagner le croisement homonyme, environ 500 mètres plus loin.<br> <br> Monter sur la droite pour rejoindre les maisons du « Mas de Leuilly » et continuer par une large piste jusqu’à une patte d’oie. Quitter alors la piste pour emprunter le sentier raide s’élevant façon presque rectiligne dans les bois jusqu’à déboucher 220 mètres plus haut à un col (1074 m). Partir sur la gauche pour atteindre la bosse 1106 m et filer quasiment à plat vers le Sud par le large sentier de crête qui croise 500 mètres plus loin le carrefour « Aiguille de Quaix ». Laisser pour l’instant le sentier de descente sur la droite (on y reviendra plus tard) et continuer en direction du belvédère que l’on atteint après avoir contourné l’Aiguille de Quaix et quelques rochers ruiniformes par la gauche. Cet emplacement privilégié où poussent de nombreuses asphodèles au printemps est tout trouvé pour enfin tirer le pique-nique hors du sac.<br> <br> Revenir au croisement « Aiguille de Quaix » et descendre maintenant sur la gauche. Après la traversée d’une large trouée, on tombe sur une piste forestière que l’on suit brièvement sur la droite avant de trouver le premier des deux panneaux « Les Prés de l’Aiguille » (970 m). Replonger à gauche pour traverser entre ces belles prairies fleuries. Au second panneau « Les Prés de l’Aiguille » (950 m), laisser sur la droite le sentier menant à Planfay et poursuivre tout droit en descendant par Trépaloup, puis gagner le hameau de Petesset. Suivre alors la route D 105a sur la gauche pendant environ 1 km pour retrouver la mairie de Quaix et la voiture.</p>",
