    resume:
      "Bien au delà du lac qui porte également son nom, le Goléon se cache au fond d'un cirque magnifique bordé au Nord par les Aiguilles de la Saussaz qui prolongent la longue dorsale des Aiguilles d'Arves toutes proches. Le débonnaire Glacier Lombard qui mène doucement à l'arête Nord-Ouest ne doit pas être pris complètement à la légère : on y a vu quelques belles crevasses dans la chaleur de ces derniers étés.",
    depart: "Lac du Goléon - 2438 m",
    acces:
      "De Grenoble, suivre l'A 480 et prendre la sortie \"stations de l'Oisans\" pour rejoindre Vizille. Continuer par la N 91 par Bourg d’Oisans puis jusqu'à la Grave. Traverser le village et le premier tunnel qui suit et tourner à droite juste à sa sortie pour monter en direction du Chazelet et des Hières. Après une dizaine de lacets, prendre à droite à un croisement pour rejoindre successivement les hameaux de Ventelon et des Hières où la route se transforme en piste jusqu'à Valfroide. Se garer au terminus de la piste carrossable.",
    itineraire:
      "<p>A partir du lac du Goléon (2438 m) l'itinéraire est d'une évidence que seuls les fonds de vallée peuvent offrir : il suffit de suivre, donc, le bord gauche (rive droite du torrent du Maurian) du fond du vallon remontant dans une direction Nord-Ouest vers le glacier Lombard. A 2480 m, on passe devant le refuge Carraud (fermé). Vers 2550 m, le sentier commence à remonter des pentes d'éboulis plus soutenues et rejoint plus haut le pied de grandes dalles sur lesquelles rebondissent quelques cascades. Le vallon se rétrécit ensuite franchement et, selon les années, on rencontre déjà les premiers névés. On atteint la base du glacier Lombard aux alentours de 3000 m. S'encorder là, et remonter la gentille pente enneigée en visant le col (3236 m) situé juste à gauche du Bec de Grenier. Une fois au col, enlever les crampons si on les avait mis et si la neige ne recouvre pas les rochers, puis suivre l'esthétique arête Nord-Ouest jusqu'au sommet de l'Aiguille du Goléon. Sans être difficile, les lauzes instables qui composent l'arête rendent l'évolution quelque peu délicate.</p> <p>La descente s'effectue par le même itinéraire.</p> <p>Ce topo ne constitue en aucun cas une sécurité pour son utilisateur. Ce dernier pratique la montagne à ses risques et périls, est autonome et responsable de lui-même et des gens qu’il emmène. Dans le cas contraire, ils fera appel à un professionnel de l’encadrement.</p>",
