    gpx: "http://www.grenoble-montagne.com",
    resume:
      "Le magnifique chaînon des Aiguilles de l’Argentière qui marque la fin du massif de Belledonne au Nord-Est se divise en deux groupes : les petites aiguilles qui s’étendent à l'Est du col de la Combe et les grandes aiguilles qui s’étirent du col de Combe Madame au col de la Combe. Ces dernières sont elles-mêmes séparées en deux parties par le col Dulong de Rosnay. A l’Est de celui-ci on distingue la partie orientale comprenant l’aiguille Saint-Phalle (2897 m), l’aiguille d'Olle (2885 m) et l’Aiguille Joseph Gaillard (2757 m). A l'ouest du col Dulong de Rosnay on identifie la partie occidentale des grandes aiguilles dont la traversée que nous décrivons ici démarre à l'aiguille de Marcieu (2906 m) avant de franchir successivement l’aiguille Michel (2915 m), l’aiguille Baroz (2904 m), l’aiguille Repiton-Préneuf (2900 m) et l’aiguille Dulong de Rosnay (2914 m). Cette chevauchée sur le fil de quelques-uns des plus hauts et des plus sauvages sommets de Belledonne compte parmi les trois plus belles courses d’arête du massif.",
    depart: "Col du Glandon - 1924 m",
    acces:
      "De Grenoble, suivre l'A 480 et prendre la sortie \"stations de l'Oisans\" pour rejoindre Vizille. Continuer par la D1091 en direction de Bourg d’Oisans jusqu’à Rochetaillée. Bifurquer alors à gauche en direction d’Allemond et passer successivement le lac du Verney, le Rivier d’Allemont puis le lac de Grand-Maison avant de gagner le col du Glandon.",
    itineraire:
      "<p><strong>Itinéraire :</strong></p> <p>Approche :<br>Du parking du col du Glandon, partir vers l’Ouest en montant petit à petit dans les prés pour contourner la bosse du Carrelet par le Sud. Après un petit plateau on rejoint assez rapidement le lac de la Combe. Poursuivre sur une trajectoire Ouest-Nord-Ouest en s’élevant dans la casse de l’Argentière, au pied des hautes aiguilles que l’on franchira un peu plus tard. Vers 2750 m, à la rencontre de la Crête du Pin et de l’aiguille de Marcieu, on atteint le pied d’un couloir qui donne accès aux arêtes.</p> <p>Traversée :<br>Remonter le couloir jusqu’à sa sortie sur l’arête. S’il est en neige il pourra être confortable de le remonter jusqu’en-haut avant de sortir par des gradins faciles (2b). Si au contraire le couloir est trop sec, il est préférable de s'échapper en rive droite pour remonter une arête en bon rocher (3b).<br><br>Sur l’arête, s’engager donc vers l’Est et contourner par le Nord le ressaut défendant l’aiguille de Marcieu pour remonter des rochers raides (3a) et atteindre le sommet de cette dernière (2906 m). Descendre en contournant un gendarme par la gauche pour trouver le rappel (10 m) permettant de rejoindre le col Cadiat.<br><br>Remonter une rampe oblique sur la droite dans des rochers clairs et des gros blocs, avant de revenir à gauche sur l'arête (3b) et atteindre le sommet de l'aiguille Michel (2915 m), culmen des aiguilles d'Argentière, contrairement à ce que la carte IGN laisse penser en lui attribuant l'altitude 2913 m. Traverser le sommet en restant sur le fil puis désescalader sur de grosses écailles pour trouver un relais au-dessus d'un ressaut vertical (rappel 6 m).<br><br>Descendre jusqu'à la brèche et monter à l'aiguille Baroz (2904 m) par une fissure-cheminée qui s’élève à droite de l’arête (3b) sur un rocher raide. Suivre le fil de l'arête et quand elle se raidit, passer en versant Sud jusqu'à la brèche suivante (3b).<br><br>Remonter une excellente fissure (4b, friend coincé) et sortir à gauche par une dernière fissure (2<sup>nd</sup> friend coincé) pour atteindre le relais au sommet de l'aiguille Repiton-Préneuf (2900 m). Faire un rappel de 25 m jusqu’à la brèche suivante en opérant une descente oblique dans l’impressionnante dalle du versant Nord.<br><br>Remonter sur la droite de l'arête (3b) pour atteindre l'aiguille Dulong de Rosnay (2914 m). Du sommet, poursuivre vers l'Est et descendre au-dessus du col Dulong de Rosnay en restant sur le fil de l'arête. Rejoindre des vires herbeuses pour louvoyer jusqu'à arriver au-dessus d'un ressaut raide qui domine le col. Suivre une vire vers la gauche pour atteindre le relais d’un rappel de 30 m qui marque la fin de la traversée occidentale des grandes aiguilles.<br><br>Descente :<br>Descendre en versant Nord par le glacier de l’Argentière puis en suivant la combe de la Croix dont on retrouve le sentier aux Plan des Trois Eaux à 2134 m. Ne reste plus qu’à suivre ce chemin qui retrouve le col du Glandon après une large traversée et une brève remontée.</p> <p><em>Ce topo ne constitue en aucun cas une sécurité pour son utilisateur. Ce dernier pratique la montagne à ses risques et périls, est autonome et responsable de lui-même et des gens qu’il emmène. Dans le cas contraire, ils fera appel à un professionnel de l'encadrement.</em></p>",
